INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 16, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, 100101, 2, 0, 155, "人助け、応援", 44, "A", 27, "人助けが大好き！　前向き格闘娘", "東山奈央", "トゥインクルウィッシュ", "ヒヨリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, 100201, 2, 0, 158, "料理、人間観察", 47, "O", 5, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", "トゥインクルウィッシュ", "ユイ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, 100301, 2, 0, 163, "読書、乗馬、お茶", 46, "B", 12, "クールで何事にも真っ直ぐな剣士", "早見沙織", "トゥインクルウィッシュ", "レイ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 9, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, 100401, 5, 0, 128, "いたずら、探検", 27, "O", 10, "探検好きのイタズラっ子", "諸星すみれ", "リトルリリカル", "ミソギ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 12, "？？？", 11, 100501, 8, 0, 146, "ヒーローごっこ", 40, "O", 25, "ヒーローに憧れる騎士見習いの少女", "下田麻美", "王宮騎士団（NIGHTMARE）", "マツリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 13, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, 100601, 7, 0, 150, "サックス", 42, "O", 22, "甘え上手なみんなの人気者", "浅倉杏美", "悪魔偽王国軍（ディアボロス）", "アカリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 14, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, 100701, 7, 0, 130, "プリンを食べること", 32, "B", 23, "プリン大好きゴースト娘", "雨宮天", "悪魔偽王国軍（ディアボロス）", "ミヤコ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 14, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, 100801, 15, 0, 150, "鏡で自分を見ること", 40, "AB", 10, "ボクは誰よりも美しい", "大空直美", "ヴァイスフリューゲル　ランドソル支部", "ユキ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 17, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, 100901, 13, 0, 159, "小説執筆", 45, "A", 5, "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", "トワイライトキャラバン", "アンナ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 16, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, 101001, 10, 0, 155, "空想、ぬいぐるみ集め", 42, "O", 22, "マホマホ王国のプリンセス", "内田真礼", "自警団（カォン）", "マホ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 15, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, 101101, 3, 0, 156, "お裁縫", 44, "A", 25, "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", "ラビリンス", "リノ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 17, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 12, 101201, 6, 0, 156, "妹と遊ぶこと、二度寝、昼寝、早寝", 46, "A", 24, "みんなのために超能力を使う眠り姫", "大橋彩香", "フォレスティエ", "ハツネ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "", 8, 101301, 13, 0, 166, "読書、魔法", 55, "O", 21, "オタク全開な魔法少女", "佳村はるか", "トワイライトキャラバン", "ナナカ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 15, "test", 11, 101401, 10, 0, 152, "読書、推理", 41, "AB", 3, "頭脳明晰な美少女名探偵", "水瀬いのり", "自警団（カォン）", "カスミ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 21, "test", 9, 101501, 6, 0, 165, "絵本作り", 54, "O", 5, "母性溢れる優しいみんなの「ミサト先生」", "國府田マリ子", "フォレスティエ", "ミサト");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, 101601, 14, 0, 167, "ファッション", 48, "O", 10, "天真爛漫で人気者のカリスマモデル", "上坂すみれ", "ルーセント学院", "スズナ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 19, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, 101701, 10, 0, 158, "踊り、空手", 53, "A", 7, "いつでも「なんくるないさ～」な天然娘", "高森奈津美", "自警団（カォン）", "カオリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 23, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 8, 101801, 14, 0, 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, "B", 14, "多くの男性を魅了する無垢な女教師", "伊藤静", "ルーセント学院", "イオ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 10, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 4, 102001, 5, 0, 117, "かわいいもの集め", 21, "O", 3, "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", "リトルリリカル", "ミミ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 102101, 9, 0, 150, "観劇、おままごと", 40, "B", 9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", "サレンディア救護院", "クルミ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 13, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 11, 102201, 7, 0, 150, "ゲーム全般", 40, "O", 22, "人見知りであまのじゃくな女の子", "原紗友里", "悪魔偽王国軍（ディアボロス）", "ヨリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 14, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, 102301, 9, 0, 148, "屋内でできる遊び", 38, "B", 10, "ぷうきちといつも一緒！", "芹澤優", "サレンディア救護院", "アヤネ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 15, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, 102501, 9, 0, 154, "ご奉仕", 43, "O", 12, "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", "サレンディア救護院", "スズメ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 17, "test", 1, 102601, 11, 0, 144, "あんパン", 42, "B", 1, "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", "牧場（エリザベスパーク）", "リン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 16, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 102701, 13, 0, 154, "実験、裁縫、料理", 43, "B", 30, "運命の相手に一途すぎる乙女", "橋本ちなみ", "トワイライトキャラバン", "エリコ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 17, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 10, 102801, 9, 0, 156, "経営、お茶会", 43, "A", 4, "救護院を経営する優しい庶民派お嬢様", "堀江由衣", "サレンディア救護院", "サレン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 1, 102901, 4, 0, 157, "舞台鑑賞、ダンス", 40, "B", 24, "歌って踊れる大人気アイドル", "日笠陽子", "カルミナ", "ノゾミ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 16, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, 103001, 15, 0, 163, "忍法開発", 51, "O", 31, "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", "ニノン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, 103101, 7, 0, 157, "占い", 42, "AB", 22, "占いが得意な霊能少女", "大坪由佳", "悪魔偽王国軍（ディアボロス）", "シノブ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 18, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 3, 103201, 12, 0, 157, "慈善事業", 45, "AB", 12, "一人前の商人を目指すパワフルお嬢様", "松嵜麗", "メルクリウス財団", "アキノ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 20, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, 103301, 11, 0, 142, "漫才", 35, "B", 3, "みんなを笑顔にするお笑い牧場主", "新田恵海", "牧場（エリザベスパーク）", "マヒル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 22, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 3, 103401, 12, 0, 164, "ウインドーショッピング", 55, "A", 16, "純情でほっとけない大人の女性", "今井麻美", "メルクリウス財団", "ユカリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 8, "test", 2, 103601, 5, 0, 118, "お勉強", 21, "A", 2, "礼儀正しくしっかり者のちびっ子優等生", "小倉唯", "リトルリリカル", "キョウカ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 13, "test", 8, 103701, 8, 0, 149, "剣術、年長者をからかう", 43, "A", 11, "義理堅くてからかい好きな剣術少女", "茅原実里", "王宮騎士団（NIGHTMARE）", "トモ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 14, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, 103801, 11, 0, 153, "読書、お散歩", 40, "A", 3, "読書が趣味の病弱少女", "小清水亜美", "牧場（エリザベスパーク）", "シオリ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("エルフ", 13, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, 104001, 6, 0, 158, "友達作りのイメトレ", 44, "AB", 6, "「友達」に憧れる、エルフの森の女の子", "花澤香菜", "フォレスティエ", "アオイ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 104201, 4, 0, 163, "各種楽器", 46, "O", 3, "人々を守るために歌う、唱喚士の少女", "福原綾香", "カルミナ", "チカ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 17, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 8, 104301, 10, 0, 168, "お菓子作り", 54, "O", 9, "男勝りで情に厚いワイルド娘", "小松未可子", "自警団（カォン）", "マコト");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", "??", "test", 5, 104401, 7, 0, 172, "世界征服", 50, "A", 5, "かつては夜を支配した最強の吸血鬼", "丹下桜", "悪魔偽王国軍（ディアボロス）", "イリヤ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 18, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, 104501, 15, 0, 157, "小説を読むこと", 49, "AB", 19, "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "クウカ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 104601, 12, 0, 158, "猫とたわむれること", 48, "AB", 1, "弱きを助け強きをくじく猫娘", "沼倉愛美", "メルクリウス財団", "タマキ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 25, "？？？", 10, 104701, 8, 0, 171, "格闘技、湯浴み", 50, "A", 25, "素顔を見せない冷静沈着な女性騎士", "川澄綾子", "王宮騎士団（NIGHTMARE）", "ジュン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 20, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 104801, 12, 0, 163, "傭兵などのアルバイト", 49, "O", 11, "仕事も私事も効率優先な傭兵少女", "田所あずさ", "メルクリウス財団", "ミフユ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 18, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, 104901, 3, 0, 168, "家事全般", 54, "O", 24, "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", "ラビリンス", "シズル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 11, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, 105001, 14, 0, 120, "ファッション誌鑑賞、コスメ集め", 22, "A", 3, "ちょっとおませな恋に恋する女の子", "久野美咲", "ルーセント学院", "ミサキ");
