INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 107901, 12, 0, 158, "猫とたわむれること", 48, "AB", 1, "弱きを助け強きをくじく猫娘", "沼倉愛美", "メルクリウス財団", "タマキ（サマー）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 20, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 108001, 12, 0, 163, "傭兵などのアルバイト", 49, "O", 11, "仕事も私事も効率優先な傭兵少女", "田所あずさ", "メルクリウス財団", "ミフユ（サマー）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, 108101, 7, 0, 157, "占い", 42, "AB", 22, "占いが得意な霊能少女", "大坪由佳", "悪魔偽王国軍（ディアボロス）", "シノブ（ハロウィン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 14, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, 108201, 7, 0, 130, "プリンを食べること", 32, "B", 23, "プリン大好きゴースト娘", "雨宮天", "悪魔偽王国軍（ディアボロス）", "ミヤコ（ハロウィン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 11, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, 108301, 14, 0, 120, "ファッション誌鑑賞、コスメ集め", 22, "A", 3, "ちょっとおませな恋に恋する女の子", "久野美咲", "ルーセント学院", "ミサキ（ハロウィン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, 108401, 4, 0, 163, "各種楽器", 46, "O", 3, "人々を守るために歌う、唱喚士の少女", "福原綾香", "カルミナ", "チカ（クリスマス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, 108501, 9, 0, 150, "観劇、おままごと", 40, "B", 9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", "サレンディア救護院", "クルミ（クリスマス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 14, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, 108601, 9, 0, 148, "屋内でできる遊び", 38, "B", 10, "ぷうきちといつも一緒！", "芹澤優", "サレンディア救護院", "アヤネ（クリスマス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 16, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, 108701, 2, 0, 155, "人助け、応援", 44, "A", 27, "人助けが大好き！　前向き格闘娘", "東山奈央", "トゥインクルウィッシュ", "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, 108801, 2, 0, 158, "料理、人間観察", 47, "O", 5, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", "トゥインクルウィッシュ", "ユイ（ニューイヤー）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, 108901, 2, 0, 163, "読書、乗馬、お茶", 46, "B", 12, "クールで何事にも真っ直ぐな剣士", "早見沙織", "トゥインクルウィッシュ", "レイ（ニューイヤー）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 16, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, 109001, 13, 0, 154, "実験、裁縫、料理", 43, "B", 30, "運命の相手に一途すぎる乙女", "橋本ちなみ", "トワイライトキャラバン", "エリコ（バレンタイン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 18, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, 109101, 3, 0, 168, "家事全般", 54, "O", 24, "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", "ラビリンス", "シズル（バレンタイン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 17, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 12, 109201, "", 0, 156, "読書", 55, "AB", 1, "英霊と契約を結んだマナリアの天才王女", "日笠陽子", "？？？", "アン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 15, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 2, 109301, "", 0, 144, "食べること、眠ること", 45, "O", 4, "マナリア魔法学院の新入生", "こやまきみこ", "？？？", "ルゥ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("半人半竜", 17, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 11, 109401, "", 0, 167, "ピアノ", 67, "B", 3, "人を超越した力を有す心優しい竜姫", "福原綾香", "？？？", "グレア");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 18, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, 109501, 15, 0, 157, "小説を読むこと", 49, "AB", 19, "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "クウカ（オーエド）");
