INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("獣人族", 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, 116801, 12, 0, 158, "猫とたわむれること", 48, "AB", 1, "弱きを助け強きをくじく猫娘", "沼倉愛美", "メルクリウス財団", "タマキ（作業服）");
