INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("魔族", 18, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, 117901, 14, 0, 167, "ファッション", 48, "O", 10, "天真爛漫で人気者のカリスマモデル", "上坂すみれ", "ルーセント学院", "スズナ（ハロウィン）");
